nit: instead of comment you can try self commenting code

constexpr auto defaultState = "Enabled";
asyncResp->res.jsonValue["Status"]["State"] = defaultState;

comments are easier to ignore, someone may change value assigned to ["Status"]["State"] but forget to change comment.

In case of internal error current code will send something like this:

{ "Status": { "State": "Enabled" }, "Error": "internal error" }

The idea is to remove this default value (line 15) and do:
asyncResp->res.jsonValue["Status"]["State"] = *value ? "Enabled" : "Absent";

This way State won't be filled when errors occurs.

